import './GlobalNav.css';
import menu from './Menu';
import Menuhome from "./Menuhome";


function GlobalNav({className,onNav})
{
    const lists = menu.map(item=>{
        return(

                <a onClick={onNav} href="{item.path}"  key={item.name} data-target={item.name}>{item.name} </a>

        );
    });

    return(
        <nav className={'topnav  ${className}'}>
            <button className="dropdown-button" onClick="showDropdown()">
                <i aria-label="Clickable dropdown menu icon" className="gg-menu"></i>
            </button>
            <div className="dropdown-content inactive" id="menu-dropdown">
                <Menuhome onNav={onNav}/>
                                {lists}
            </div>
        </nav>
    );
}

export default GlobalNav;
